import React, { useState, useEffect } from 'react';

const EmployeeList = () => {
  const [employees, setEmployees] = useState([]);

  useEffect(() => {
    // Fetch employee data from API or local storage
    const fetchedEmployees = [
      {
        id: 1,
        name: 'Hukum Gupta',
        email: 'hukum@company.com',
        mobile: '954010044',
        designation: 'HR',
        gender: 'Male',
        course: ['MCA'],
        createdate: '13-Feb-21',
        image: 'hukum.png',
      },
      {
        id: 2,
        name: 'Manish',
        email: 'manish@company.com',
        mobile: '954010033',
        designation: 'Sales',
        gender: 'Male',
        course: ['BCA'],
        createdate: '12-Feb-21',
        image: 'manish.png',
      },
      // Add more employees here...
    ];
    setEmployees(fetchedEmployees);
  }, []);

  return (
    <div>
      <h2>Employee List</h2>
      <table>
        <thead>
          <tr>
            <th>Image</th>
            <th>Name</th>
            <th>Email</th>
            <th>Mobile No</th>
            <th>Designation</th>
            <th>Gender</th>
            <th>Course</th>
            <th>Create Date</th>
          </tr>
        </thead>
        <tbody>
          {employees.map((employee) => (
            <tr key={employee.id}>
              <td><img src={employee.image} alt={employee.name} width="50" /></td>
              <td>{employee.name}</td>
              <td>{employee.email}</td>
              <td>{employee.mobile}</td>
              <td>{employee.designation}</td>
              <td>{employee.gender}</td>
              <td>{employee.course.join(', ')}</td>
              <td>{employee.createdate}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default EmployeeList;
